$FKColumns = %EXEC_ADD_IN("EADDLEnh", "GetForeignKeyColumnsString", classGUID, "")%
Table
{
  %TRANSFORM_REFERENCE("MultivalueAttributeTable", attGUID)%
  $tableName = %className% + "_" + %attName%
  $tableName = %EXEC_ADD_IN("EADDLEnh", "ConvertName", $tableName, "")%
  name=%qt%$tableName%qt%
  language=%qt%%genOptDefaultDatabase%%qt%

  %if attAllowDuplicates == "T"%
  PrimaryKey
  {
	Column
	{
		name=%qt%%TO_LOWER($tableName)%_id%qt%
		type=%qt%%CONVERT_TYPE(genOptDefaultDatabase, "Integer")%%qt% 
	}
  }
  %EXEC_ADD_IN("EADDLEnh", "GetForeignKeyColumnsStringWithConstrs", classGUID, "", "T", "")%
  Column
  {
	name=%qt%%EXEC_ADD_IN("EADDLEnh", "ConvertName", attName, "T")%%qt%
	type=%qt%%CONVERT_TYPE(genOptDefaultDatabase, attType)%%qt% 
	NotNull
  } 
  %else%
  PrimaryKey
  {
	$FKColumns
  	Column
	{
		name=%qt%%EXEC_ADD_IN("EADDLEnh", "ConvertName", attName, "T")%%qt%
		type=%qt%%CONVERT_TYPE(genOptDefaultDatabase, attType)%%qt% 
	}
  }
  %endIf%
}
ForeignKey
{
  %TRANSFORM_REFERENCE("FK", attGUID)%
  Source
  {
    %TRANSFORM_REFERENCE("MultivalueAttributeTable", attGUID)%
    multiplicity="0..*"
	$FKColumns
  }
  Target
  {
    %TRANSFORM_REFERENCE("Table", classGUID)%
	multiplicity="1"
	$FKColumns
  }
  %EXEC_ADD_IN("EADDLEnh", "MarkUpdateDeleteCascadeIfApplicable", classGUID, "")%
}

